import React from 'react';
import '../../App.css';
import './signup.css';

function signup() {
    return (
        <div className='card-container'>
            <div className='header'>Login</div>
            <div className='content'>
                <div className='image'>
                    <img src='/' />
                </div>
            </div>
        </div>
    )
}

export default signup
